import React from 'react';

function MAVJLogo() {
  return (
    <div className="logo-container">
      <img
        src="https://raw.githubusercontent.com/MyAlkalineVeganJourney/J2E/main/MAVJLogo.png"
        alt="J2E Logo"
        style={{ maxWidth: '300px', height: 'auto' }}
      />
    </div>
  );
}

export default MAVJLogo;
